var flag=true;
var caption=["Jean Henri Dunant","Friendship","Service","Health"];
var home= {
	initialize: function() {
        this.bindEvents();
    },
    bindEvents: function() {
        var center=".index";
        var center_left=".activities";
        var center_right=".gallery";
        var left=".about";
        var right=".contacts";
        var select={
            ".about": "data:image/svg+xml;base64,",
            ".activities": "data:image/svg+xml;base64,",
            ".index": "data:image/svg+xml;base64,",
            ".gallery": "data:image/svg+xml;base64,",
            ".contacts": "data:image/svg+xml;base64,"
        };
        var deselect={
            ".about": "data:image/svg+xml;base64,",
            ".activities": "data:image/svg+xml;base64,",
            ".index": "data:image/svg+xml;base64,",
            ".gallery": "data:image/svg+xml;base64,",
            ".contacts": "data:image/svg+xml;base64,"
        };
        var fromLeft=function(){
            $(left).css({
                visibility:'hidden'
            });
            $(center).css({
                'background-image': 'url('+deselect[center]+')'
            });
            var temp=center_left;
            center_left=center;
            center=left;
            left=temp;
            var time1=setTimeout(function(){
                $(left).css({
                    top: '12%',
                    left: '16%'
                });
                $(center_left).css({
                    top: '16%',
                    left: '31%'
                });
                $(center).css({
                    top: '20%',
                    left: '47.5%',
                    'background-image': 'url('+select[center]+')'
                });
                var time2=setTimeout(function(){
                    $(center).css({
                        'background-image': 'url('+select[center]+')',
                        visibility:'visible'
                    });
                    clearTimeout(time2);
                },700);
                clearTimeout(time1);
            },600);
        }
        var fromCenterLeft= function(){
            var temp=center_left;
            center_left=center;
            center=temp;
            $(center_left).css({
                top: '16%',
                left: '31%',
                'background-image': 'url('+deselect[center_left]+')'
            });
            $(center).css({
                top: '20%',
                left: '47.5%',
                'background-image': 'url('+select[center]+')'
            });
        }
        var fromRight=function(){
            $(right).css({
                visibility:'hidden'
            });
            $(center).css({
                'background-image': 'url('+deselect[center]+')'
            });
            var temp=center_right;
            center_right=center;
            center=right;
            right=temp;
            var time1=setTimeout(function(){
                $(right).css({
                    top: '12%',
                    left: '80%'
                });
                $(center_right).css({
                    top: '16%',
                    left: '65%'
                });
                $(center).css({
                    top: '20%',
                    left: '47.5%',
                    'background-image': 'url('+select[center]+')'
                });
                var time2=setTimeout(function(){
                    $(center).css({
                        visibility:'visible'
                    });
                    clearTimeout(time2);
                },700);
                clearTimeout(time1);
            },600);
        }
        var fromCenterRight= function(){
            var temp=center_right;
            center_right=center;
            center=temp;
            $(center_right).css({
                top: '16%',
                left: '65%',
                'background-image': 'url('+deselect[center_right]+')'
            });
            $(center).css({
                top: '20%',
                left: '47.5%',
                'background-image': 'url('+select[center]+')'
            });
        }
    	$(document).on('pageshow','.home',function(){
            $(document).on('click','.about',function(event){
                if(event.handled !== true){
                    if(left==='.about')
                        fromLeft();
                    else if(center_left === '.about')
                        fromCenterLeft();
                    else if(center_right === '.about')
                        fromCenterRight();
                    else if(right === '.about')
                        fromRight();
                    event.handled = true;
                }
                return false;
            });
            $(document).on('click','.activities',function(event){
                if(event.handled !== true){
                    if(left==='.activities')
                        fromLeft();
                    else if(center_left === '.activities')
                        fromCenterLeft();
                    else if(center_right === '.activities')
                        fromCenterRight();
                    else if(right === '.activities')
                        fromRight();
                    event.handled = true;
                }
                return false;
            });
            $(document).on('click','.index',function(event){
                if(event.handled !== true){
                    if(left==='.index')
                        fromLeft();
                    else if(center_left === '.index')
                        fromCenterLeft();
                    else if(center_right === '.index')
                        fromCenterRight();
                    else if(right === '.index')
                        fromRight();
                    event.handled = true;
                }
                return false;
            });
            $(document).on('click','.gallery',function(event){
                if(event.handled !== true){
                    if(left==='.gallery')
                        fromLeft();
                    else if(center_left === '.gallery')
                        fromCenterLeft();
                    else if(center_right === '.gallery')
                        fromCenterRight();
                    else if(right === '.gallery')
                        fromRight();
                    event.handled = true;
                }
                return false;
            });
            $(document).on('click','.contacts',function(event){
                if(event.handled !== true){
                    if(left==='.contacts')
                        fromLeft();
                    else if(center_left === '.contacts')
                        fromCenterLeft();
                    else if(center_right === '.contacts')
                        fromCenterRight();
                    else if(right === '.contacts')
                        fromRight();
                    event.handled = true;
                }
                return false;
            });
    	})
        $( document ).on( "pagecreate", ".home", function() {
            $('.home').on('click','.gallery',function(){
                $('.container').css({
                    top: '-1200px'
                });
                var time=setTimeout(function(){
                    $( ".container" ).load( "gallery.html" );
                    $('.container').css({
                        top: '28%'
                    });
                    clearTimeout(time);
                },800);
            });
        	$('.home').on('click','.about',function(){
                $('.container').css({
                    top: '-1200px'
                });
                var time=setTimeout(function(){
                    $( ".container" ).load( "about.html" );
                    $('.container').css({
                        top: '28%'
                    });
                    clearTimeout(time);
                },800);
        	});
        	$('.home').on('click','.activities',function(){
                $('.container').css({
                    top: '-1200px'
                });
                var time=setTimeout(function(){
                    $( ".container" ).load( "activities.html" );
                    $('.container').css({
                        top: '28%'
                    });
                    clearTimeout(time);
                },800);
        	});
            $('.home').on('click','.contacts',function(){
                $('.container').css({
                    top: '-3000px'
                });
                var time=setTimeout(function(){
                    $( ".container" ).load( "contacts.html" );
                    $('.container').css({
                        top: '28%'
                    });
                    clearTimeout(time);
                },800);
            });
        	$('.home').on('click','.index',function(){
                $('.container').css({
                    top: '-1200px'
                });
                var time=setTimeout(function(){
                    $( ".container" ).load( "index.html" );
                    $('.container').css({
                        top: '28%'
                    });
                    clearTimeout(time);
                },800);
        	});
            $( ".index" ).trigger( "click" );
            //motto events
            $('.home').on('mouseover','.friendship',function() {
                $('.friendship').css({
                    'background-image':'url("css/images/friendship_w.svg")'
                });
            });
            $('.home').on('mouseover','.service',function() {
                $('.service').css({
                    'background-image':'url("css/images/service_w.svg")'
                });
            });
            $('.home').on('mouseover','.health',function() {
                $('.health').css({
                    'background-image':'url("css/images/health_w.svg")'
                });
            });
            $('.home').on('mouseout','.friendship',function() {
                $('.friendship').css({
                    'background-image':'url("css/images/friendship_b.svg")'
                });
            });
            $('.home').on('mouseout','.service',function() {
                $('.service').css({
                    'background-image':'url("css/images/service_b.svg")'
                });
            });
            $('.home').on('mouseout','.health',function() {
                $('.health').css({
                    'background-image':'url("css/images/health_b.svg")'
                });
            });
        });
    }	
};